// Please enter your KQL query (Example):
// <table name>
// | where <datetime column> between (['_startTime'] .. ['_endTime']) // Time range filtering
// | where isempty(['_releaseVersion']) or <column name> in (['_releaseVersion']) // Multiple selection filtering
// | where isempty(['_environment']) or <column name> in (['_environment']) // Multiple selection filtering
// | take 100
//
//
// Created by Advent
// Advent uses partitioned joins to improve query performance. This works by executing the "partitionQuery" once for each month and then aggregating the results.
let partitionQuery = (_start:datetime, _end:datetime ) {
    cluster("ddtelinsights").database("DDTelInsights").Metric_EngagementState_Daily | where Date between (_start .. endofday(_end))// Apply required table filters
 | where (Pivot_Product == "VSCodeExtensions") | where (Pivot_ProductVersion == "All") | where (Pivot_EngagementGroup == "All") | where (EngagementState == "Tire Kickers" or EngagementState == "Occasional" or EngagementState == "Dedicated10d")
// join with "WorkloadTags" fact table
| join kind=leftsemi hint.shufflekey=Id (cluster("ddtelinsights").database("DDTelInsights").Fact_WorkloadTags_28Day
// | where Date == _date
| where (WorkloadTagsHierarchy has "VSCodeFabric/Workspaces" and (strcat(" , ", WorkloadTagsHierarchy, " , ") has " , VSCodeFabric/Workspaces , " or strcat(" , ", WorkloadTagsHierarchy, " , ") has " , VSCodeFabric/Workspaces/"))) on Id, $left.Pivot_Product == $right.Product
// Count by pivoting each funnel stage in separate columns instead of separate rows to utilize dcountif aggregator for performance reason
| summarize Count=pack_array(
['Active1d (Tire Kickers+)'] = dcountif(Id, EngagementState == "Tire Kickers" or EngagementState == "Occasional" or EngagementState == "Dedicated10d", 2),
['Engaged2d (Occasional+)'] = dcountif(Id, EngagementState == "Occasional" or EngagementState == "Dedicated10d", 2),
['Dedicated10d'] = dcountif(Id, EngagementState == "Dedicated10d", 2)) by Date
};
// Perform partitioned join by doing a union of calls to the partitionQuery for each month
union hint.spread=18
  (partitionQuery(_startTime, _endTime))
//Unpivot the data so that each count is in its own row
| mvexpand Count=Count to typeof(long), EngagementState=dynamic(['Active1d (Tire Kickers+)','Engaged2d (Occasional+)','Dedicated10d']) to typeof(string)

