let _eventName = 'fabric.vscode-fabric-functions/functionset/publish';
// Get all publish events with timestamps and add row numbers for uniqueness
let publishEvents = cluster('DDTelvscode').database('VSCodeExt').RawEventsVSCodeExt
| where ServerTimestamp between (_startTime .. _endTime)
| where EventName == _eventName
| project 
    VSCodeSessionId,
    VSCodeMachineId, 
    ServerTimestamp,
    EventName,
    Succeeded = tobool(Properties.succeeded),
    ErrorMessage = tostring(Properties.message),
    FabricEnvironment = tostring(Properties.["common.fabricenvironment"])
| order by VSCodeSessionId, ServerTimestamp asc
| serialize RowNum = row_number();
// Find the immediately preceding event for each publish event
publishEvents
| join kind=leftouter (
    publishEvents
    | project 
        VSCodeSessionId,
        PrevRowNum = RowNum,
        PriorTimestamp = ServerTimestamp,
        PriorSucceeded = Succeeded,
        PriorErrorMessage = ErrorMessage
) on VSCodeSessionId
| where PrevRowNum == RowNum - 1  // Only match with the immediately previous event in same session
| where ServerTimestamp - PriorTimestamp <= 2m  // Within 2 minutes
| where ErrorMessage != "Publish already in progress"  // Filter out "Publish already in progress" errors
| summarize 
    TotalPairs = count(),
    SecondEventFailed = countif(Succeeded == false),
    SecondEventSucceeded = countif(Succeeded == true),
    BothFailed = countif(Succeeded == false and PriorSucceeded == false),
    FirstFailedSecondSucceeded = countif(Succeeded == true and PriorSucceeded == false),
    FirstSucceededSecondFailed = countif(Succeeded == false and PriorSucceeded == true),
    BothSucceeded = countif(Succeeded == true and PriorSucceeded == true)

